DROP DATABASE IF EXISTS shopProducts;

CREATE DATABASE shopProducts;

USE shopProducts;

CREATE TABLE shops (
  id int NOT NULL,
  name varchar(30),
  city varchar(20),
  state varchar(20),
  shop_image_url varchar(100),
  PRIMARY KEY (ID)
);


CREATE TABLE products (
  id int NOT NULL,
  name varchar(80),
  price DECIMAL(5,2),
  liked varchar(5),
  id_shops int,
  PRIMARY KEY (ID)
);



CREATE TABLE images (
  id int NOT NULL,
  id_product int,
  image_url varchar(100),
  PRIMARY KEY (ID)
);


